import React from "react";
import { Button } from "@mui/material";
interface ButtonProps {
	variant?: string;
	type: string;
	onClick?: () => void;
	buttonText: string;
	className: string;
	fullWidth: string;
}

function ButtonComponent({ variant, type, buttonText }: ButtonProps) {
	return (
		<Button
			variant={variant}
			type={type}
			className={className}
			fullWidth={fullWidth}
			onClick={onClick}
		>
			{buttonText}
		</Button>
	);
}

export default ButtonComponent;
